import React from 'react';
import Container from './Container.js'
import Header from './Header'
import H1 from './H1'
import P from './P'
import Button from './Button'
import Br from './Br.js'


class Home extends React.Component {
	render() {
		return(
			<Container>
				<Header>
					<H1 big>MY TABLETOP HERO</H1>
					<P big>Begin your fable right. Become a Tabletop Hero.</P>
				</Header>
				<Container>
				<Button display='block'>Create Character</Button>

				<Button color='secondary' display='inline'>Login</Button>
				</Container>

			</Container>
		);
	}

}

export default Home;
